CREATE TABLE `foods` (
  `food_id` varchar(500) DEFAULT NULL,
  `food_name` varchar(45) DEFAULT NULL,
  `food_type` varchar(450) DEFAULT NULL,
  `food_description` varchar(1000) DEFAULT NULL,
  `food_price` double DEFAULT NULL,
  `food_discount` int DEFAULT NULL,
  `food_discount_price` double DEFAULT NULL,
  `shop_id` varchar(100) DEFAULT NULL,
  `shop_name` varchar(45) DEFAULT NULL,
  `shop_address` varchar(450) DEFAULT NULL,
  `action` tinyint DEFAULT NULL,
  UNIQUE KEY `id_UNIQUE` (`food_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
