INSERT INTO `foods` VALUES ('FD-0000001','Grilled Salmon','Fast Foods','A delicious and healthy dish featuring tender salmon fillets seasoned with herbs and spices, then grilled to perfection. Served with a side of fresh vegetables and lemon wedges.',120,10,108,'SP-0000002','Burger King','121/A Dhaka, Bangladesh',1),('FD-0000002','Margherita Pizza','Fast Foods','A classic Italian pizza topped with fresh tomato sauce, mozzarella cheese, and basil leaves. It\'s a simple yet delightful dish loved by pizza enthusiasts worldwide.',30,25,22.5,'SP-0000002','Burger King','121/A Dhaka, Bangladesh',1),('FD-0000003','Chicken Biryani','Fast Foods','A flavorful and aromatic rice dish made with marinated chicken pieces, fragrant basmati rice, and a blend of spices. It\'s a popular Indian delicacy that\'s rich in taste and aroma.',30,10,27,'SP-0000002','Burger King','121/A Dhaka, Bangladesh',1),('FD-0000004','Sushi Roll','Fast Foods','A sushi roll filled with imitation crab meat, avocado, cucumber, and sushi rice, wrapped in seaweed and served with pickled ginger, wasabi, and soy sauce. It\'s a staple in Japanese cuisine.',35,20,28,'SP-0000002','Burger King','121/A Dhaka, Bangladesh',0),('FD-0000005','Beef Steak with Garlic Butter','Bangla','A succulent beef steak grilled to perfection and served with a luscious garlic butter sauce. It\'s a mouthwatering dish that\'s perfect for meat lovers.',52,25,39,'SP-0000002','Burger King','121/A Dhaka, Bangladesh',1);
/*!40000 ALTER TABLE `foods` ENABLE KEYS */;
UNLOCK TABLES;

